import React from "react";
import axios from "axios";

function Gallery() {
  const URL = "https://api.airtable.com/v0/appgSipibWEhbQcAf/userEdits";
  useEffect(() => {
    const getImg = async () => {
      const data = await axios.get(
        URL,
        {
          header: {
            Authorizations: "Bearer keywDhrqHFhRCV57f",
          },
        },
        {
          params: {},
        }
      );
    };
  }, []);

  return <div></div>;
}

export default Gallery;
